import classes from "./Input.module.css";
import { Fragment } from "react";
let Input = (props) => {
  return (
    <Fragment className={classes.input}>
      <label htmlFor={props}>Amount </label>
      <input id="amount" type="number" defaultValue="1" />
    </Fragment>
  );
};
export default Input;
